def getStrongestExtension(class_name, extensions):
    best = None
    for extension in extensions:
        score = (len(class_name) // extension.char_width) ** (class_name.index(extension) - 1) / extension.length
        if score > best:
            best = score
    # If extension has higher score, return it
    return best
